properties.description:
Cabelas is a specialty retailer of hunting, fishing, camping and related outdoor recreation merchandise based in Sidney, NE. It uses catalogs, the Internet, and has 26 retail stores throughout the United States.

This dataset maps the 26 Cabelas retail stores. The physical address and phone numbers were retrieved from cabelas.com and the address was then geocoded to find the exact lat/lon of the store's location.

The data is current as of 12.2007. Several more stores are being planned to open in the future. These sites can be seen on another dataset entitled, &amp;quot;Future Cabelas Store Locations 12.2007&amp;quot;
